Description:

Horoscope Interpreter is designed by international author and lecturer Adrian Ross Duncan to help ordinary users understand astrology. It is designed to show that astrology works, and to give an accurate description of a person?s birth horoscope. Furthermore, the user can define any 3-year period and read about important trends in his or her life. Horoscope Interpreter displays the horoscope interactively; the user can click on any symbol on the chart and read about it in detail. The database of 80,000 towns in 300 countries compensates automatically for summertime and time zones to give an accurate horoscope anywhere in the world. It&amp;#039;s available in 12 languages.
